import React from "react";
import logo from "./logo.svg";
import "./App.css";
import MeatSteamGrindingExportButton from "./components/ExportButton";

interface MSGProps {
  batchCount: number;
}

interface BatchData {
  date: string;
}

const meatSteamGrindingExportData = [{ date: "2024-06-01" }];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <MeatSteamGrindingExportButton
          meatSteamGrindingExportData={meatSteamGrindingExportData}
          batchCount={meatSteamGrindingExportData.length}
        />
      </header>
    </div>
  );
}

export default App;
